import React from 'react';
import { useAuth } from '../../auth/useAuth';

const POS_LOKASI_MAP = {
  'Terminal Protection': [
    'Chief Terminal Protection',
    'Ruang Tunggu',
    'Walking Patrol',
    'Mezzanine Domestik',
    'Kedatangan Domestik',
    'Akses Karyawan',
    'Building Protection',
    'CCTV',
  ],
  'Non-Terminal Protection': [
    'Main Gate',
    'Chief Non-Teminal Protection',
    'Patroli',
    'Kargo',
    'Papa November',
    'Pos Congot',
  ],
  'Screening': [
    'PSCP',
    'Level 4',
    'HBS',
    'SCP LAGs',
    'SCP Transit',
    'SSCP',
    'OOG',
  ],
};

const OfficerDashboard = () => {
  const { auth } = useAuth();
  const userPos = auth?.user?.pos;
  const lokasiList = POS_LOKASI_MAP[userPos] || [];

  return (
    <div>
      <h2>Officer Dashboard</h2>
      <h3>Pos: {userPos || '-'}</h3>
      <ul>
        {lokasiList.length === 0 && <li>Tidak ada lokasi untuk pos ini.</li>}
        {lokasiList.map(lokasi => (
          <li key={lokasi}>{lokasi}</li>
        ))}
      </ul>
    </div>
  );
};

export default OfficerDashboard;
